<!DOCTYPE html>
<html lang="en">
   <head>
      <meta charset="UTF-8" />
      <meta http-equiv="X-UA-Compatible" content="IE=edge" />
      <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      <title>Document</title>
   </head>
   <body>
      <script>
         let b =[7,2,5,4,6,3,5,3]; 
         let a =[7,2,5,3,5,3];      
         let kq=[];
         for(let i =0;i<b.length;i++){
            let flag=false;
            for(let j =0;j<a.length;j++){
               if(b[i]== a[j]){
                  flag=true;
                  break;
               }
            }
            if(!flag){
               kq.push(b[i]);
            }
         }
         alert("["+kq+"]");
      </script>
   </body>
</html>
